import PropTypes from "prop-types";

const CardInfo = ({ className = "" }) => {
  return (
    <button
      className={`cursor-pointer [border:none] py-[5px] px-[15px] bg-gainsboro-100 rounded-lg flex flex-row items-start justify-start gap-4 z-[2] ${className}`}
    >
      <img
        className="h-8 w-8 relative overflow-hidden shrink-0 hidden"
        alt=""
        src="/cilpeople.svg"
      />
      <div className="flex flex-row items-start justify-start">
        <div className="w-16 relative text-sm font-interaction text-contrast-4 text-center hidden">
          Add Items
        </div>
        <div className="relative text-xl font-interaction text-contrast-3 text-left inline-block min-w-[96px] mq450:text-base">
          Edit Profile
        </div>
      </div>
    </button>
  );
};

CardInfo.propTypes = {
  className: PropTypes.string,
};

export default CardInfo;
